query:
/*+ NoNestLoop(ci t mi_idx) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id < 683255 AND ci.role_id = 10 AND t.kind_id = 7 AND t.production_year > 1911
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id < 100;
